import React, { Component } from "react";
import { Route } from "react-router-dom";
//style importer
import * as s__ from "./style";
//component importer
//utils importer
interface Props {
  isFormDisPlay: (status: boolean) => void;
  stateUser: boolean;
}

class SignInForm extends Component<Props, {}> {

  formDisplay = () => {
    this.props.isFormDisPlay(!this.props.stateUser);
  };

  formRegisterDisplay = () => {};

  formSignin = () => {
    return (
      <s__.Container>
          <form action="">
            <label>
              {" "}
              CMND: <input type="text" />
            </label>
            <hr />
            <label>
              Password: <input type="password" />
            </label>
            <hr />
            <s__.LinkRoute to="/register" onClick={() => this.formRegisterDisplay()}>
              Bạn chưa có tài khoản ?
            </s__.LinkRoute>
            <hr />
            <span onClick={this.formDisplay}>Cancel</span>
          </form>
      </s__.Container>
    );
  };

  render() {
    return <React.Fragment><Route path="/sign-in" children={this.formSignin()} /></React.Fragment>;
  }
}

export default SignInForm;
